import Link from 'next/link';

const linkStyle = {
  marginRight: 15,
};

const headerStyle = {
  background: '#F2F2F2',
  width: '100%'
}
const Header = () => (
  <div style={headerStyle}>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/contact">
      <a style={linkStyle}>Contact</a>
    </Link>
  </div>
);

export default Header;
